import './phoneLeft.scss';
import { useState } from 'react';

interface PhoneLeftProps {
    classNameAdded: string;
    elements: JSX.Element;
    explode: boolean;
}

const PhoneLeft = ({ classNameAdded = '', elements = <></>, explode = false }: PhoneLeftProps): JSX.Element => {

    const [active, setActive] = useState<boolean>(false);

    return (
        <div className={`phoneLeft ${classNameAdded}`}>
            <div className="phoneLeft__base">
                <div className={`hponeLeft__base__screen ${explode ? "phoneLeft__base__screen--explode" : ""}`} >
                    <div className="phoneLeft__base__screen__cameraTop">
                    </div>
                    <div className="phoneLeft__base__screen__message">
                        {elements}
                    </div>
                </div>
                <div className="phoneLeft__base__charger">
                </div>
                <div className="phoneLeft__base__volume-1">
                </div>
                <div className="phoneLeft__base__volume-2">
                </div>
            </div>
        </div>
    );
}

export default PhoneLeft;
